                                height={300} style={{ cursor: 'pointer', border: '2px solid #ccc', borderRadius: '8px', margin:'auto',marginBottom:'20px' }}
                            />
                            {isZoomed2 && (
                                <div className="zoomed-overlay" onClick={() => this.handleCloseClick(2)}>
                                    {/* Zoomed content for Image 2 */}
